import React, { useEffect, useState } from "react";

interface SummaryTableInterface {
  data?: any;
}
export const SummaryTable: React.FC<SummaryTableInterface> = ({ data }) => {
  const [summaryData, setsummaryData] = useState(data);

  useEffect(() => {
    setsummaryData(data);
  }, []);

  console.log(summaryData, data);
  return (
    <div>
      <table className="table">
        <thead>
          <tr>
            <th className="each-column-border">Rank </th>
            <th className="each-column-border">Entity Name</th>
          </tr>
        </thead>
        <tbody>
          {data?.map((item, index) => (
            <tr>
              <td className="each-column-border">{index + 1}</td>
              <td className="each-column-border">{item.companyName}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
